import React from 'react';
import '../assets/scss/main.scss';
import News from './News';

interface ICarouselProps {
  index: number;
  onRotateClick: (rotateLeft: boolean) => any; 
}

class Carousel extends React.Component<ICarouselProps> {



  public render() {

    const newsList = [
      <News title={'Title 1'} subtitle={'This is the subtitle'} author={'Author'} body={'body'} date={'14/10/2021'} imageUrl={'https://i2.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/1a-EDICION-8M6H0859-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />,
      <News title={'Title 2'} subtitle={'This is the subtitle'} author={'Author'} body={'body'} date={'14/10/2021'} imageUrl={'https://i2.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/1a-EDICION-8M6H0859-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />,
      <News title={'Title 3'} subtitle={'This is the subtitle'} author={'Author'} body={'body'} date={'14/10/2021'} imageUrl={'https://i2.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/1a-EDICION-8M6H0859-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />,
      <News title={'Title 4'} subtitle={'This is the subtitle'} author={'Author'} body={'body'} date={'14/10/2021'} imageUrl={'https://i2.wp.com/revista.seg-social.es/wp-content/uploads/2021/10/1a-EDICION-8M6H0859-copia.jpg?resize=620%2C264&ssl=1'} collapsed={true} />
    ]

    const onClickLeft = () => {
      this.props.onRotateClick(true);
    }

    const onClickRight = () => {
      this.props.onRotateClick(false);
    }

    return (
      <div id='enveloped' className="container-xxl">
        <div id="leftArrow" onClick={onClickLeft}>
          &#60;
        </div>
        <div id="newsCard">
          {newsList[this.props.index]}
        </div>
        <div id="rightArrow" onClick={onClickRight}>
          &#62;
        </div>
      </div>
    );
  }
}

export default Carousel;
